import React, { useEffect, useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import Divider from '@material-ui/core/Divider';
import ListItemText from '@material-ui/core/ListItemText';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import Avatar from '@material-ui/core/Avatar';
import Typography from '@material-ui/core/Typography';
import { userService } from '../../services/user.service';
import { Fragment } from 'react';

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
        maxWidth: '36ch',
        backgroundColor: theme.palette.background.paper,
    },
    inline: {
        display: 'inline',
    },
}));

export default function ListFriend(props) {
    const classes = useStyles();
    const [listFollwers, setListFollwers] = useState();
    const [listFollwings, setListFollwings] = useState();
    useEffect(() => {
        userService.getFollwer(props.userId).then(res => {
            console.log(res.data.data.friendList[0].followers);
            setListFollwers(res.data.data.friendList[0].followers);
        }).catch(err => [
            console.log(err)
        ])
        userService.getFollwing(props.userId).then(res => {
            console.log(res.data.data.friendList[0].followings);
            setListFollwings(res.data.data.friendList[0].followings);
        }).catch(err => [
            console.log(err)
        ])
    }, [])
    return (
        <Fragment>
            <List className={classes.root}>
                {
                    listFollwers ? listFollwers.map((ele) => {
                        return <ListItem alignItems="flex-start">
                            <ListItemAvatar>
                                <Avatar alt="Remy Sharp" src={ele.user.photo} />
                            </ListItemAvatar>
                            <ListItemText
                                primary={ele.user.firstname}
                                secondary={
                                    <React.Fragment>
                                        <Typography
                                            component="span"
                                            variant="body2"
                                            className={classes.inline}
                                            color="textPrimary"
                                        >
                                            {ele.user.address}
                                        </Typography>
                                    </React.Fragment>
                                }
                            />
                        </ListItem>
                    }) : null
                }
            </List>
            <List className={classes.root}>
                {
                    listFollwings ? listFollwings.map((ele) => {
                        return <ListItem alignItems="flex-start">
                            <ListItemAvatar>
                                <Avatar alt="Remy Sharp" src={ele.user.photo} />
                            </ListItemAvatar>
                            <ListItemText
                                primary={ele.user.firstname}
                                secondary={
                                    <React.Fragment>
                                        <Typography
                                            component="span"
                                            variant="body2"
                                            className={classes.inline}
                                            color="textPrimary"
                                        >
                                            {ele.user.address}
                                        </Typography>
                                    </React.Fragment>
                                }
                            />
                        </ListItem>
                    }) : null
                }
            </List>
        </Fragment>
    );
}
